import React from 'react'
import { useHistory } from 'react-router'

const MyNotes = () => {

    let history = useHistory();

    const allNotes = () => {
        history.push("/notes")
    }

    return (
        <div>
            <h1>My notes</h1>
            {/* <button onClick={allNotes}>notes</button> */}
        </div>
    )
}

export default MyNotes
